import './App.css';
import React from "react"
import Authenticate from "./Pages/main.js"
import TypePage from './Pages/typing';

class App extends React.Component{
      constructor(props) {
            super(props)

            this.state = {
                  loggedIn : false,
                  profile: ""
            }

            this.handler = this.handler.bind(this)
      }

      handler(name) {
            this.setState({ loggedIn: true })
            this.setState({ profile:name })
      }

      render(){
            return(
                  <div className=''>
                        {
                              this.state.loggedIn ?  <TypePage profile={this.state.profile}/> : <Authenticate handler={this.handler}/>
                        }

                  </div>

            )
      }
}





export default App;
